    return (
        <div>
            <div className='py-4'>
                <div className='container'>
                    <div className='row'>
                        <div className='col-md-12'>
                            <h6>Vaša narudžba je zaprimljena te će uskoro stići na Vašu adresu.</h6>
                            <h6>Zahvaljujemo Vam se na povjerenju.</h6>
                        </div>                     
                    </div>
                </div>
            </div>
        </div>
    )
}

